    @Bean
    @Override
    public MockGenomeNexusImpl annotator() {
        return this;
    }

    public AnnotatedRecord makeMockAnnotatedRecord(MutationRecord record) {
        VariantAnnotation gnResponse = null;
        try {
            gnResponse = makeMockGenomeNexusResponse(mockGenomeNexusHgvsResponseMap.get(extractGenomicLocation(record)));
            this.setGnResponse(gnResponse);
            this.setMutationRecord(record);
        }
        catch (IOException e) {
            throw new RuntimeException(e);
        }

        return convertResponseToAnnotatedRecord(REPLACE);
    }

    private VariantAnnotation makeMockGenomeNexusResponse(String mockReturnJsonString) throws IOException {
        ObjectMapper mapper = new ObjectMapper();
        mapper.setMixInAnnotations(this.initMixinMap());
        return mapper.readValue(mockReturnJsonString, VariantAnnotation.class);
    }

    private Map<Class<?>, Class<?>> initMixinMap()
    {
        Map<Class<?>, Class<?>> mixinMap = new HashMap<>();

        mixinMap.put(VariantAnnotation.class, VariantAnnotationMixin.class);
        mixinMap.put(TranscriptConsequence.class, TranscriptConsequenceMixin.class);

        return mixinMap;
    }
